import React , { Component }from 'react';
import './App.css';
import Map from './Components/Map'
class App extends Component {


  constructor(props){

    super(props);
    this.state = {
      pointer:{lat:'30.741482',long:'76.768066'}
    }

  }


  render(){
    const data = [
      {
        id: 1,
        name: "Park Slope",
        latitude: "40.6710729",
        longitude: "-73.9988001"
      },
      {
        id: 2,
        name: "Bushwick",
        latitude: "40.6942861",
        longitude: "-73.9389312"
      },
      {
        id: 3,
        name: "East New York",
        latitude: "40.6577799",
        longitude: "-73.9147716"
      }
    ];

    data[0].circle = {
      radius: 1000,
      options: {
        strokeColor: "#ff0000"
      }
    };
    return(
      <div className="App">
       <Map
    center={{ lat: this.state.pointer.lat, lng: this.state.pointer.long }}
    zoom={12}
    places={data}
    googleMapURL="https://maps.googleapis.com/maps/api/js?key=AIzaSyBqqW5pq28Qera8ScOykfyKpiIP5Cc0XAM"
    loadingElement={<div style={{ height: `100%` }} />}
    containerElement={<div style={{ height: `800px` }} />}
    mapElement={<div style={{ height: `100%` }} />}
  />, 
      </div>
    )
    }

}

export default App;
